import React from 'react'
import { ReactDOM } from 'react'

function PortalDemo() {
  return ReactDOM.createPortal(
    <div>
      <h1>Portal Heading</h1>
    </div>,
    document.getElementById('portal-roor')
  )
}

export default PortalDemo
